      out.write("<script>\r\n");
      out.write("function refreshDragover(){\r\n");
      out.write("\r\n");
      out.write("(function(){\r\n");
      out.write("  //each droppable element needs this for its dragover event\r\n");
      out.write("  var allowDragover = function (event) {\r\n");
      out.write("    //prevent the browser from any default behavior\r\n");
      out.write("    event.preventDefault();\r\n");
      out.write("  },\r\n");
      out.write("  //each dragable element needs this for its dragstart event\r\n");
      out.write("  dragStartHandler = function (event) {\r\n");
      out.write("    var dragIcon = null;\r\n");
      out.write("    //set a reference to the element that is currenly being dragged\r\n");
      out.write("    event.originalEvent.dataTransfer.setData(\"id\",event.target.id);\r\n");
      out.write("    //create a custom drag image\r\n");
      out.write("    dragIcon = document.createElement('img');\r\n");
      out.write("    dragIcon.src = 'staticresources/images/drag_img.png';\r\n");
      out.write("    //set the custom drag image\r\n");
      out.write("    event.originalEvent.dataTransfer.setDragImage(dragIcon, 30, 30); \r\n");
      out.write("  },\r\n");
      out.write("  //each of the four light-brown boxes at top have this bound to their drop event\r\n");
      out.write("  dropHandlerSingle = function (event) {\r\n");
      out.write("    var id = '';\r\n");
      out.write("    //prevent the browser from any default behavior\r\n");
      out.write("    event.preventDefault();\r\n");
      out.write("    //only allow one child element at a time\r\n");
      out.write("    if($(this).children().length){return;}\r\n");
      out.write("    //get a reference to the element that is being dropped\r\n");
      out.write("    id = event.originalEvent.dataTransfer.getData(\"id\");\r\n");
      out.write("    //add the hasChild class so that the UI can update\r\n");
      out.write("    $(event.target).addClass('hasChild');\r\n");
      out.write("    //trigger the custom event so that we can update the UI\r\n");
      out.write("    $(document).trigger('custom:dropEvent');\r\n");
      out.write("    //move the dragged element into the drop target\r\n");
      out.write("    event.target.appendChild(document.getElementById(id));\r\n");
      out.write("  },\r\n");
      out.write("  //the box that holds the four blue dragable boxes on page load has this bound to its drop event\r\n");
      out.write("  dropHandlerMultiple = function (event) {\r\n");
      out.write("    event.preventDefault();\r\n");
      out.write("    var id = event.originalEvent.dataTransfer.getData(\"id\");\r\n");
      out.write("    $(event.target).addClass('hasChild');\r\n");
      out.write("    event.target.appendChild(document.getElementById(id));\r\n");
      out.write("    $(document).trigger('custom:dropEvent');\r\n");
      out.write("  };\r\n");
      out.write("  $(document).ready(function(){\r\n");
      out.write("    //cache a reference to all four blue draggable boxes\r\n");
      out.write("    var $dragElements = $('.dragElement');\r\n");
      out.write("    //make each dragElement draggable\r\n");
      out.write("    $dragElements.attr('draggable','true');\r\n");
      out.write("    //bind the dragStartHandler function to all dragElements\r\n");
      out.write("    $dragElements.bind('dragstart',dragStartHandler);\r\n");
      out.write("    //bind the dropHandlerSingle function to all of the droppable elements (omit the original container)\r\n");
      out.write("    $('.droppable').not('.multipleChildren').bind('drop',dropHandlerSingle);\r\n");
      out.write("    //bind the dropHandlerMultiple function to the .droppable.multipleChildren element\r\n");
      out.write("    $('.droppable.multipleChildren').bind('drop',dropHandlerMultiple);\r\n");
      out.write("    //after something is dropped\r\n");
      out.write("    $(document).on('custom:dropEvent',function(){\r\n");
      out.write("      //make sure the DOM has been updated\r\n");
      out.write("      setTimeout(function(){\r\n");
      out.write("        //check each droppable element to see if it has a child\r\n");
      out.write("        $('.droppable').each(function(){\r\n");
      out.write("          //if this element has no children\r\n");
      out.write("          if (!$(this).children().length){\r\n");
      out.write("            //remove the hasChild class\r\n");
      out.write("            $(this).removeClass('hasChild');\r\n");
      out.write("          }\r\n");
      out.write("        });\r\n");
      out.write("      },50);\r\n");
      out.write("    });\r\n");
      out.write("    //bind the appropriate handlers for the dragover, dragenter and dragleave events\r\n");
      out.write("    $('.droppable').bind({\r\n");
      out.write("      dragover: allowDragover,\r\n");
      out.write("      dragenter: function() {\r\n");
      out.write("        //ignore this event for the original container of the drag elements\r\n");
      out.write("        if ( $(this).hasClass('multipleChildren') ){return;}\r\n");
      out.write("        $(this).addClass('dragEnter');\r\n");
      out.write("      },\r\n");
      out.write("      dragleave: function() {\r\n");
      out.write("        $(this).removeClass('dragEnter');\r\n");
      out.write("      }\r\n");
      out.write("    });\r\n");
      out.write("  })\r\n");
      out.write("})();\r\n");
      out.write("}\r\n");
      out.write("</script>\r\n");
